import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
  },
  menu: {
    marginVertical: 30,
    height: '85%',
    width: '90%',
    alignItems: 'center',
  },
});

export default styles;
